                <div>
                  <img alt="" style={{ height: "400px", width: "90%", marginLeft: "70px", border: "10px solid transparent" }} className="coverimg" src="images/coverimg.png" />  
                </div>
           
                <p className=" text-white text-center display-1 py-3" style={{fontFamily: "cinematic", fontSize:"70px",marginBottom:"150px"}}>Welcome to your profile <span style={{color:"red"}}> Ala</span></p>   
                </div>         
            
        );
    }
}

